    @Nullable
    @Override
    public IBinder onBind(Intent intent) {
        return mBinder;
    }

    //permite recuperar una instancia del servicio a travs de un punto de acceso
    //conexin entre activity y servicio
    public class MyBinder extends Binder{
        ServiceHeartRate getService(){
            return ServiceHeartRate.this; // se retorna instancia del servicio
        }
    }

    @Override
    public void onCreate(){
        super.onCreate();
        mHandler = new Handler(Objects.requireNonNull(Looper.myLooper()));
        isPaused = true;
        br = new HRDataReciever();
        IntentFilter filt = new IntentFilter("analogData");
        this.registerReceiver(br, filt);
    }

    //como si estuviese corriendon una tarea largamente
    public void startPretendLongRunningTask(){
        if(runnable == null) {
            runnable = new Runnable() {

                @Override
                public void run() {
//                    calcularHRSensores();
                    calcularHRantiguo();
                    mHandler.postDelayed(this, 1000);
                }
            };
        }
        mHandler.postDelayed(runnable, 1000);
    }

    @Override
    public void onTaskRemoved(Intent rootIntent){
        super.onTaskRemoved(rootIntent);
        unregisterReceiver(br);
        stopSelf();
    }

    public void unPausedPretendLongRunningTask(){
        isPaused = false;
        startPretendLongRunningTask();
    }

    public int getPpm(){
        return ppm;
    }

    public class HRDataReciever extends BroadcastReceiver {
        int portbvp;
        int posbvp;

        public HRDataReciever(){

            SharedPreferences preferences = getSharedPreferences("BVPConfig", Context.MODE_PRIVATE);
            portbvp = Integer.parseInt(Objects.requireNonNull(preferences.getString("port", "9")));

            if(portbvp != 9){
                posbvp = portbvp - 1;
            }
        }

        @Override
        public void onReceive(Context context, Intent intent) {
            if(COLLECT_DATA) {
                double bvp_value = intent.getExtras().getIntArray("analogData")[posbvp];
                data.add(bvp_value);
            }
        }
    }


    public void calcularHRSensores() {

        while (data.size() < sample_rate) {

        }

        resultsMap = signalDetector.analyzeDataForSignals(data, lag, threshold, influence, data.size());
        signalsList = resultsMap.get("signals");
        filteredDataList = resultsMap.get("filteredData");
        datos = resultsMap.get("data");

        COLLECT_DATA = false;

        for (int j = value_i; j < sample_rate ; j++) {
            dif = dif + 1;

            if ((j + 1) < signalsList.size()){
                if (signalsList.get(j) == 0){
                    if (signalsList.get((j+1)) == 1){

                        pulsaciones = pulsaciones + 1;
                        pulsaciones2 = pulsaciones2 + 1;

                        dif = 0;

                    }
                    else if(signalsList.get((j+1)) == -1){
                        continue;
                    }
                }
                else if(signalsList.get(j) == -1){
                    if (signalsList.get((j+1)) == 1){
                        //valor = signalsList.get(i);
                        pulsaciones = pulsaciones + 1;
                        pulsaciones2 = pulsaciones2 + 1;
                        //System.out.println("PULSACION EN LA MEDICION: "+ i);
                        //System.out.println("VALOR DE DIF " + dif);
                        dif = 0;
                    }
                    else if(signalsList.get((j+1)) == 0){
                        continue;
                    }
                }
                else if(signalsList.get(j) == 1){
                    continue;
                }
            }

            if ((j % (sample_rate*5)) == 0){
                ppm = (ppm + (pulsaciones2*60/5))/2;

                Log.d("Valor de ppm: ", String.valueOf(ppm));

                //publishProgress(String.valueOf(ppm));

                //mHandler.postDelayed(runnable, 1000);

                pulsaciones2 = 0;
            }
        }
        data.clear();
        COLLECT_DATA = true;
    }


